import './App.css';
import React from "react"


function App() {
  const date=new Date()
  const hours=date.getHours()
  let timeofday
  if(hours<12)
  timeofday="morning"
  else if(hours>12&&hours<17)
  timeofday="afternoon"
  else
  timeofday="night"
  const styles={
    color:"#FF8C00",
    backgroundcolor:"#FF2D00",
  }
  return (
    <h1 style={styles}>Good {timeofday}!</h1>
  );
}

export default App;
